    this.setState({[name]:value});
  }
  handleSubmit = () =>{

   alert("d");
  }
  render() {
    return (
    <div className="container">
      <div className="card card-info ">
        <div className="card-header">
          <h3 className="card-title">Нэвтрэх хэсэг{this.state.email}</h3>
        </div>
        <form className="form-horizontal">
          <div className="card-body">
            <div className="form-group row">
              <label htmlFor="inputEmail3" className="col-sm-2 col-form-label">И-МЭЙЛ</label>
              <div className="col-sm-10">
                <input type="email" className="form-control" name="email" placeholder="И-МЭЙЛ" onChange={this.handleType}/>
              </div>
            </div>
            <div className="form-group row">
              <label htmlFor="inputPassword3" className="col-sm-2 col-form-label">НУУЦ ҮГ</label>
              <div className="col-sm-10">
                <input type="password" className="form-control" name="passowrd" placeholder="НУУЦ ҮГ" />
              </div>
            </div>
          </div>
          <div className="card-footer">
            <button type="submit" className="btn btn-info" onClick={this.handleSubmit}>Нэвтрэх</button>
          </div>
        </form>
      </div>
    </div>
    )
  }
}
